ISLAMABAD, May 28 (APP): Federal Minister for Kashmir Affairs Ali Ameen Gandapur, Member National Assembly Amir Mehmood Kayani and Senator Saifullah Niazi called on Prime Minister Imran Khan here on Friday.
During the meeting, strategy for the upcoming elections in Azad Kashmir was discussed.
